import React from "react";
import CardList from "./CardList";
import SearchBox from "./Searchbox";
import { robots } from "./robots";

const state = {
  robots: robots,
  searchfield: "",
};
const App = () => {
  return (
    <div className="tc">
      <h1>Bazoil Friends</h1>
      <SearchBox />
      <CardList robots={robots} />
    </div>
  );
};

export default App;
